import React, {useEffect,useState} from "react";
import axios from "axios";

const Card = ({ dog }) => {
    return (
      <div>
        <h2>{dog.name}</h2>
        <p>Breed: {dog.breed}</p>
        <p>Age: {dog.age}</p>
        <p>Zip Code: {dog.zipCode}</p>
      </div>
    );
  };

  const Cards = ({ filters }) => {
    const [dogs, setDogs] = useState([]);

    useEffect(() => {
      const fetchData = async () => {
        try {
          const response = await axios.get('https://frontend-take-home-service.fetch.com/dogs/search', {
            params: filters,
            headers: {
              'fetch-api-key': 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpYXQiOjE2NzgzMDU2MTF9.Ky49nXH6qgHJQ0CBsZGYsP7_Is2am3u5j3RAdEl457s',
            },
          });
          setDogs(response.data.resultIds);
        } catch (error) {
          console.log(error);
        }
      };

      fetchData();
    }, [filters]);

    return (
      <div>
        {dogs.map((id) => (
          <Card key={id} dog={{ name: 'Dog Name', breed: 'Dog Breed', age: 'Dog Age', zipCode: 'Zip Code' }} />
        ))}
      </div>
    );
  };

  export default Cards;



